import { countries } from "./data";

// import your component here  and use it in the App.js file or wherever you want to display this data, like so: <Country />
function Country() {
  return (
    <>
      <div>
            <h1 className="text-center">Countries</h1>
                {/* Add your country list here */ }
            <ul>
                {countries.map((country) => (
                    <li key={country.id}>
                        <img src={country.flag} alt={country.name} />
                        <div>
                            <h2>{country.name}</h2>
                            <p>Capital: {country.capital}</p>
                            <p>Population: {country.population}</p>
                            <p>Region: {country.region}</p>
                            <p>Sub Region: {country.subregion}</p>
                <p>
                  Languages:{" "}
                  {country.languages.map((language) => language.name).join(", ")}
                </p>
                            <p>Borders: {country.borders.join(", ")}</p>
                <p>
                  Currencies:{" "}
                  {country.currencies.map((currency) => currency.name).join(", ")}
                </p>

                            <button>Learn More</button>
                            <button>Add to Favorites</button>
                            <button>Remove from Favorites</button>
                            <button>Share</button>
        </div>
                        </li>
                    ))}
                </ul>
            </div>
        </>
  );
}

export default Country;
